        digitalTimer.classList.remove('hide');

    })

    menuAnalog.addEventListener('click', () => {
        menuItem.classList = 'hide';
        analogTimer.classList.remove('hide');

    })

    menuVisual.addEventListener('click', () => {
        menuItem.classList = 'hide';
        visualTimer.classList.remove('hide');

    })
